import {ImageUtil_GIF} from "./ImageUtil._gif";
import {ImageFormat} from "..";
// // import ImageUtil_ImageParser from "./ImageUtil._base";
// import NdArray from "ndarray";
import {FileUtil} from "./FileUtil";

describe("GIF image helper", () => {

    test("Handles empty DataURL", () => {
        const imageDataURL = 'data:image/gif;base64,';
        const img = new ImageUtil_GIF(imageDataURL);
        const imageItem = img.buildImageItem(
            img,
            FileUtil.getFileParts('./sprites/hero/happy.gif'),
            FileUtil.getFileBytes(imageDataURL, 'gif')
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Handles malformed DataURL", () => {
        const imageDataURL = 'daft;';
        const gif = new ImageUtil_GIF(imageDataURL);
        const imageItem = gif.buildImageItem(
            gif,
            FileUtil.getFileParts('./sprites/hero/happy.gif'),
            FileUtil.getFileBytes(imageDataURL, 'gif')
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Handles malformed DataURL", () => {
        const imageDataURL = 'data:image/gif;base64,xxxx';
        const gif = new ImageUtil_GIF(imageDataURL);
        const imageItem = gif.buildImageItem(
            gif,
            FileUtil.getFileParts('./sprites/hero/happy.gif'),
            FileUtil.getFileBytes(imageDataURL, 'gif')
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Reads from DataURL", () => {
        const imageDataURL = 'data:image/gif;base64,';
        const gif = new ImageUtil_GIF(imageDataURL);
        const imageItem = gif.buildImageItem(
            gif,
            FileUtil.getFileParts('./sprites/hero/happy.gif'),
            FileUtil.getFileBytes(imageDataURL, 'gif')
        );

        expect(imageItem?.frames?.length).toEqual(6);
        expect(imageItem?.frames?.flat()[0].width).toEqual(114);
        expect(imageItem?.frames?.flat()[0].height).toEqual(200);
        expect(imageItem?.frames?.flat()[0].data?.length).toEqual(114 * 200 * 4);
    });

});
